import React, { useState } from 'react' 
import { useHistory } from "react-router-dom";
import sd from "../assets/img/ZooLogos/SanDiego.png";
import bronx from "../assets/img/ZooLogos/bronx.png";

function Navigation() {
    let history = useHistory();

    function handleClick(src) {
      history.push("/AcctPage", src)
    }
    //const debug = () => console.log(history.location());

    return (
     <div>
        <button onClick={handleClick(src)} type="button">
            <img 
                src={sd} 
                id="icon"
                alt="SDZooLogo" 
                title="SDZoo"> 
            </img>
        </button>
        <button onClick={handleClick(src)} type="button">
            <img 
                src={sd} 
                id="icon"
                alt="SDZooLogo" 
                title="SDZoo"> 
            </img>
        </button>
     </div>
    );
  }
  export default Navigation;
